import React, { Component } from 'react';
import './App.css';
import ListMovie from './movie/ListMovie';
import Movie from './Movie';
import { Route } from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <div>
        <Route
          path={`/`}
          component={ListMovie}>
        </Route>
        <Route
          path={`/:id`}
          component={Movie}>
        </Route>
      </div>

    );
  }
}

export default App;
